  <style>
    * {
      -webkit-box-sizing: border-box;
      box-sizing: border-box;
      margin: 0;
      padding: 0
    }

    ul li {
      list-style: none
    }

    .wrapper {
      display: -webkit-box;
      display: -ms-flexbox;
      display: flex;
      -webkit-box-orient: vertical;
      -webkit-box-direction: normal;
      -ms-flex-direction: column;
      flex-direction: column;
      -webkit-box-pack: center;
      -ms-flex-pack: center;
      justify-content: center;
      margin: 0 auto;
      max-width: 1077px;
      width: 100%
    }

    html {
      -webkit-text-size-adjust: none;
      -moz-text-size-adjust: none;
      -ms-text-size-adjust: none;
      text-size-adjust: none;
      font-family: sans-serif;
      font-size: 10px;
      font-weight: 400;
      height: 100%
    }

    @media screen and (max-width:1000px) {
      html {
        font-size: 8px
      }
    }

    @media screen and (max-width:620px) {
      html {
        font-size: 6px
      }
    }

    @media screen and (max-width:410px) {
      html {
        font-size: 5px
      }
    }

    @media screen and (max-width:360px) {
      html {
        font-size: 4.6px
      }
    }

    @media screen and (max-height:420px) and (orientation:landscape) {
      html {
        font-size: 4.5px
      }
    }

    body {
      background: #000;
      color: #fff;
      display: -webkit-box;
      display: -ms-flexbox;
      display: flex;
      font-size: 2rem;
      height: 100%
    }

    img,
    svg {
      display: block
    }

    .player,
    .video-content {
      position: relative
    }

    .player {
      background: hsla(0, 0%, 100%, .3);
      height: calc(100vh - 20rem);
      max-height: 62rem;
      z-index: 100
    }

    .player__play {
      left: 50%;
      margin-top: -6rem;
      position: absolute;
      top: 50%;
      -webkit-transform: translate(-50%, -50%);
      transform: translate(-50%, -50%)
    }

    .player__video {
      overflow: hidden;
      z-index: -1
    }

    .player__video,
    .player__video img {
      height: 100%;
      left: 0;
      position: absolute;
      top: 0;
      width: 100%
    }

    .player__video img {
      -webkit-filter: blur(7px);
      filter: blur(7px);
      -o-object-fit: cover;
      object-fit: cover;
      -o-object-position: center;
      object-position: center;
      z-index: 1
    }

    .player__video:after {
      background: rgba(0, 0, 0, .4);
      content: "";
      height: 100%;
      left: 0;
      position: absolute;
      top: 0;
      width: 100%;
      z-index: 2
    }

    .success-text {
      color: #b0b0b0;
      font-size: 4rem;
      font-weight: 400;
      left: 50%;
      max-width: 1077px;
      position: fixed;
      text-align: center;
      top: 57%;
      -webkit-transform: translate(-50%, -50%);
      transform: translate(-50%, -50%);
      width: 100%;
      z-index: 200
    }

    .success-text b,
    .success-text strong {
      color: #fff
    }

    .success-arrow {
      -webkit-animation-duration: 1s;
      animation-duration: 1s;
      -webkit-animation-fill-mode: both;
      animation-fill-mode: both;
      -webkit-animation-iteration-count: infinite;
      animation-iteration-count: infinite;
      -webkit-animation-name: sbMsgArrow;
      animation-name: sbMsgArrow;
      -webkit-animation-timing-function: ease-in-out;
      animation-timing-function: ease-in-out;
      left: 170px;
      position: fixed;
      top: 130px;
      z-index: 200
    }

    .success-arrow svg {
      -webkit-transform: scaleX(-1);
      transform: scaleX(-1)
    }

    .player__head {
      display: -webkit-box;
      display: -ms-flexbox;
      display: flex;
      font-size: 2.4rem;
      left: 0;
      padding: 3.5rem 4rem;
      position: absolute;
      top: 0;
      width: 100%;
      -webkit-box-align: center;
      -ms-flex-align: center;
      align-items: center
    }

    .player__title {
      margin-right: 2rem
    }

    .player__title-right {
      margin-left: auto
    }

    .player__bottom {
      bottom: 0;
      left: 0;
      padding: 0 4rem 2rem;
      position: absolute;
      width: 100%
    }

    .player__progress {
      background: hsla(0, 0%, 100%, .2);
      height: .5rem;
      margin-bottom: 2rem
    }

    .player__progress-load {
      background: hsla(0, 0%, 100%, .5);
      height: .5rem;
      position: relative;
      width: 5rem
    }

    .player__progress-load svg {
      position: absolute;
      right: 0;
      top: 50%;
      -webkit-transform: translate(50%, -50%);
      transform: translate(50%, -50%)
    }

    .player__controls {
      display: -webkit-box;
      display: -ms-flexbox;
      display: flex;
      -webkit-box-align: center;
      -ms-flex-align: center;
      align-items: center;
      -webkit-box-pack: justify;
      -ms-flex-pack: justify;
      justify-content: space-between
    }

    .player__time {
      color: #8d8d8d
    }

    .player__time span {
      color: #b8b8b8
    }

    .info {
      margin-bottom: auto;
      padding: 4rem 4rem 0
    }

    .info,
    .info__platform {
      display: -webkit-box;
      display: -ms-flexbox;
      display: flex;
      -webkit-box-align: center;
      -ms-flex-align: center;
      align-items: center
    }

    .info__logo {
      margin-right: 1rem
    }

    .info__title {
      font-size: 2.4rem;
      font-weight: 700
    }

    .info__subscribe {
      color: #777
    }

    .info__right {
      color: #777;
      margin-left: auto
    }

    .info__comments,
    .info__right,
    .info__view {
      display: -webkit-box;
      display: -ms-flexbox;
      display: flex;
      -webkit-box-align: center;
      -ms-flex-align: center;
      align-items: center
    }

    .info__comments,
    .info__view {
      margin-right: 2rem
    }

    .info__comments svg,
    .info__view svg {
      margin-right: 1rem
    }

    .info__dots {
      margin-left: 1rem
    }

    @-webkit-keyframes sbMsgArrow {
      0% {
        -webkit-transform: translate(0);
        transform: translate(0)
      }

      50% {
        -webkit-transform: translate(5px, -5px);
        transform: translate(5px, -5px)
      }

      to {
        -webkit-transform: translate(0);
        transform: translate(0)
      }
    }

    @keyframes sbMsgArrow {
      0% {
        -webkit-transform: translate(0);
        transform: translate(0)
      }

      50% {
        -webkit-transform: translate(5px, -5px);
        transform: translate(5px, -5px)
      }

      to {
        -webkit-transform: translate(0);
        transform: translate(0)
      }
    }

    .mobile .wrapper,
    .tablet .wrapper {
      -webkit-box-pack: start;
      -ms-flex-pack: start;
      justify-content: flex-start
    }

    .mobile .success-text,
    .tablet .success-text {
      margin-top: auto;
      padding: 4rem 2rem;
      position: static;
      -webkit-transform: none;
      transform: none
    }

    .mobile .success-arrow,
    .tablet .success-arrow {
      bottom: 15rem;
      left: 50%;
      margin-left: 10px;
      top: auto
    }

    .mobile .player__play,
    .tablet .player__play {
      margin-top: 0
    }

    .mobile .player,
    .tablet .player {
      height: calc(100vh - 35rem)
    }

    @media screen and (max-width:620px) {

      .mobile .player,
      .tablet .player {
        max-height: 250px
      }
    }
